OBS: tem que ficar azul para o link funcionar corretamente. O mesmo vale para marcar qualquer membro que desejarem que a marcação seja vista pela pessoa.

DIRETRIZES DO GRUPO

Sejam benvindos todos os novos membros !

O maior objetivo deste grupo, é formar uma militância bolsonarista no Brasil.

● Grupo de apoio incondicional ao Presidente Jair Messias Bolsonaro;

● Grupo a favor da criminalização do socialismo e do comunismo;

● É expressamente proibido qualquer conteúdo de apologia ao nazismo, fascismo, socialismo,  e ao comunismo;

● Este não é um grupo de debates sobre temas irrelevantes, fofocas de política, temas sensacionalistas. O grupo é voltado para os estudos  sobre política, a criminalização do comunismo, e sobre como podemos libertar O Nosso País dos inimigos que prejudicam ao Povo, e o desenvolvimento da Nação.

 ● Proibido postagens da chamada "Direita Burra" (veja no banner amarelo fixado no alto deste grupo, a lista de grande parte da direita burra);

● Não é permitido postagens de violência explícita (gore), violência contra crianças, idosos, e animais;

● Evitem qualquer discussão ou debates sobre temas religiosos, terraplanismo/terraesferismo, doutrinas em geral, e assuntos especulativos. Salvo quando forem temas relacionados com a História ou Geopolítica, etc;

● Conteúdos de pedofilia serão automaticamente removidos e devidamente denunciados às autoridades competentes;

● Proibido conteúdos obscenos e pornográficos;

● Proibido links de venda de produtos ou promoções de afiliados;

● Evitem discussões e xingamentos no grupo. Caso haja alguma desavença entre alguns membros, por favor resolvam no privado. (Salvo quando for um comunista/infiltrado. Estes merecem e devem ser escrachados);

● Caso algum membro note postagens indevidas, marque no grupo a postagem digitando o termo @admin , que a mesma será checada assim que for visualizada;

● Denunciem os infiltrados pois aqueles que se omitem, interagem, ou aceitam comunistas no ambiente, podem ser confundidos como tal;

● O descumprimento das diretrizes acarretarão desde advertência e silenciamento, até o banimento definitivo do grupo; 

● Respeite os administradores e os outros membros. Todos estamos juntos em igualdade, aprendendo com o Dr Marcelo Frazão em sua Sala de Aula Pública;

● Aqueles que sofrerem restrições ou banimento e que forem reclamar, solicitar ajuda, ou uma segunda chance ao Professor, deverão usar a [ LINHA DIRETA com Dr Marcelo Frazão ], e em hipótese alguma enviar mensagem pelo privado do Professor, ou dos administradores, pois os as mensagens são tratadas e diariamente  monitoradas. Ele precisa de toda a concentração possível para escrever os seus livros e dar as aulas para o grupo.

